            "סילבוס": "הקורס מתאר את היסודות הפיסיקליים מאחורי הכימות של תהליכים ביולוגיות ברמת המולקולה והתא הבודד. טכניקות מתקדמות לריצוף ד.נ.א., דימוי תאים במיקרוסקופיה באמצעות \"ספר-רזולוציה\", שימוש במעבר אנרגיה פלורסנטית למדידת מרחקים מולקולריים. תוצאות למידה: בסיום הקורס הסטודנט ידע: 1. יסודות ועקרונות הביו-פיזיקליים אשר מאפשרים מדידות ברמת המולקולה הבודדת. 2. העקרונות הביו-הנדסיים של טכניקות מדידה של מולקולות בודדות. 3. ליישם את ההבנה של עקרונות אלו במסגרת אפליקציות ביו-רפואיות כגון ריצוף מהיר של ד.נ.א, מדידיות תוך תאיות בסופר-רזולוציה ואפיון כוחות ומאמצים של מולקולות ביולוגיות בודדות. 4. כיצד לקרוא מאמרים בתחום, להציגם בצורה תמציתית אך ברורה ולבקר את החומר המוצג בצורה מדעית.",
