            "סילבוס": "הציון ייקבע עפ\"י מעקב והערכה במשך הסמסטר ו\/או מבחני מיומנות. הרישום לנבחרת מתבצע ע\"י המאמן לאחר בחינת רמתו הספורטיבית של המועמד במהלך שלושת השיעורים הראשונים של הסמסטר. סטודנט שיתקבל לאחת הנבחרות או קורסי המתקדמים חייב לבטל מיידית את רישומו למקצוע ספורט אחר, אחרת לא ייקלט רישומו. סטודנט אינו רשאי להירשם ליותר מאחד ממקצועות החינוך הגופני והנבחרות באותו סמסטר. נוכחות חובה בכל השיעורים. להלן פירוט הנבחרות: אתלטיקה קלה, כדור עף - אולמות וחופים, כדור סל, כדור רגל, טניס, טניס שולחן, ריצות ארוכות, כדור יד, ג'ודו, סייף, שייט, שחמט, קראטה, סלסה - להקה, שחייה, כדור מים, להקת מחול, סקווש, ניווט, אופני הרים, באולינג, גלשני מפרש, טאיקוונדו, קארטינג, דיבייט, קיאקים, סנונית, שייט.",
